     2â†’/**
     3â†’ * Multi-Provider Proxy Server for Claude Code
     4â†’ * Enables GLM, Featherless.ai, Google Gemini, and Anthropic models with full tool support
     5â†’ *
     6â†’ * Features:
     7â†’ * - Tool calling emulation for models without native support (abliterated models)
     8â†’ * - Multiple provider support with automatic format translation
     9â†’ * - Seamless integration with Claude Code's MCP tools
    10â†’ *
    11â†’ * Usage:
    12â†’ *   node model-proxy-server.js [port]          # Start proxy server
    13â†’ *   node model-proxy-server.js --gemini-login  # Login to Google via OAuth
    14â†’ *
    15â†’ * Then start Claude Code with:
    16â†’ *   ANTHROPIC_BASE_URL=http://localhost:PORT claude
    17â†’ *
    18â†’ * Model Prefixes:
    19â†’ *   glm/glm-4           -> GLM (ZhipuAI)
    20â†’ *   featherless/...     -> Featherless.ai (with tool emulation)
    21â†’ *   google/gemini-pro   -> Google Gemini
    22â†’ *   anthropic/...       -> Native Anthropic (passthrough)
    23â†’ *   (no prefix)         -> Native Anthropic (passthrough)
    24â†’ */
    25â†’
