   395â†’    stream: anthropicBody.stream || false
   396â†’  };
   397â†’
   398â†’  // Add tools if not emulating (native support)
   399â†’  if (!emulateTools && anthropicBody.tools && anthropicBody.tools.length > 0) {
   400â†’    result.tools = anthropicToolsToOpenAI(anthropicBody.tools);
   401â†’  }
   402â†’
   403â†’  return result;
   404â†’}
