   487â†’/**
   488â†’ * Make HTTP/HTTPS request
   489â†’ */
   490â†’function makeRequest(url, options, body) {
   491â†’  return new Promise((resolve, reject) => {
   492â†’    const parsedUrl = new URL(url);
   493â†’    const protocol = parsedUrl.protocol === 'https:' ? https : http;
   494â†’
   495â†’    const reqOptions = {
   496â†’      hostname: parsedUrl.hostname,
   497â†’      port: parsedUrl.port,
   498â†’      path: parsedUrl.pathname + parsedUrl.search,
   499â†’      method: options.method || 'POST',
   500â†’      headers: options.headers || {}
   501â†’    };
   502â†’
   503â†’    const req = protocol.request(reqOptions, (res) => {
   504â†’      let data = '';
   505â†’
   506â†’      res.on('data', (chunk) => {
   507â†’        data += chunk;
   508â†’      });
   509â†’
   510â†’      res.on('end', () => {
   511â†’        resolve({
   512â†’          status: res.statusCode,
   513â†’          headers: res.headers,
   514â†’          body: data
   515â†’        });
   516â†’      });
   517â†’    });
   518â†’
   519â†’    req.on('error', (err) => {
   520â†’      reject(err);
   521â†’    });
   522â†’
   523â†’    if (body) {
   524â†’      req.write(typeof body === 'string' ? body : JSON.stringify(body));
   525â†’    }
   526â†’
   527â†’    req.end();
   528â†’  });
   529â†’}
