  // Check multiple possible header names (case-insensitive)
  const apiKey = headers['x-api-key'] ||
                 headers['authorization']?.replace('Bearer ', '') ||
                 ANTHROPIC_API_KEY;

  if (!apiKey) {
    log(`âœ— Anthropic: API key not configured`, 'red');
